import React from "react";



// Project Section text
const Text=()=>

<text className="text">
<size className="size"> A tailor-made buying advice at home </size>
<p>  YoShip is an innovative concept of delivery, advice and sales at home, with the same buying experience coming from luxury brands.   </p>

<p>   Licensed drivers have their own workspaces, bundling all services needed to track their customers, manage their invoices and to deliver new orders. </p>

<p>       Also registered luxury brands and companies, have access to their orders with sales statistics and reports, from approved drivers according to coming deliveries. </p>

</text> 


export default Text;
